import React from 'react';
import { BrowserRouter as Router, Route, Switch ,Routes} from 'react-router-dom';
import Login from './Login';
import Game from './Game';

function App() {
  return (
        <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/game" element={<Game />} />
        </Routes>
      </Router>
  );
}

export default App;
